import React from 'react';
import './assetss/css/App.css';
import "bootstrap/dist/css/bootstrap.css";

import Login from './components/Login';
import Dashboard from './components/Dashboard';
import Comuna from './components/Comuna';
import Editar from './components/Editar';
import Condominio from './components/Condominios y departamentos/Condominios/RegistrarCondominios';
import Departamento from './components/Condominios y departamentos/Condominios/RegistrarDepartamento';
import Articulo from './components/Condominios y departamentos/Artículos/RegistrarArticulo';
import AgenciaExterna from './components/ServiciosExtras/AgenciaExterna';

import {BrowserRouter as Router, Switch, Route} from 'react-router-dom';
function App() {
  return (
    <React.Fragment>
      <Router>
        <Switch>
          <Route path="/" exact render ={ props=> ( <Login {...props} />)}></Route>
          <Route path="/dashboard" exact render ={ props=> ( <Dashboard {...props} />)}></Route>
          <Route path="/condominio" exact render={props => (<Condominio {...props}/>)}></Route>
          <Route path="/Comuna" exact render ={ props=> ( <Comuna {...props} />)}></Route>
          <Route path="/Editar" exact render ={ props=> ( <Editar {...props} />)}></Route>
          <Route path="/departamento" exact render={props => (<Departamento {...props}/>)}></Route>
          <Route path="/articulo" exact render={props => (<Articulo {...props}/>)}></Route>
          <Route path="/agencia" exact render={props => (<AgenciaExterna {...props}/>)}></Route>

        </Switch>
      </Router>
    </React.Fragment>
  );
}

export default App;
